import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-B.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-BI.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-C.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-L.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-LI.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-R.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/Ubuntu-RI.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/UbuntuMono-R.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/UbuntuMono-RI.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/UbuntuMono-B.ttf';
import './Helpers/fonts/ubuntu-font-family-0.83/UbuntuMono-BI.ttf';
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
